}

  render(){
    return(
      <div className="App">
        <ParticlesBg className='particles' color="#ffffff" num={300} type="cobweb" bg={true} />
        <Navigation />
        <Logo />
        <Rank />
        <ImageLinkForm onInputChange={this.onInputChange} onButtonSubmit={this.onButtonSubmit}  />
        <FaceRecognition imageUrl = {this.state.imageUrl} />
      </div>
    );
  }
}

export default App;
